static int yy_init_globals (void)
{
   /* Initialization is the same as for the non-reentrant scanner.
   * This function is called from fortranscannerYYlex_destroy(), so don't allocate here.
   */

   (yy_buffer_stack) = 0;
   (yy_buffer_stack_top) = 0;
   (yy_buffer_stack_max) = 0;
   (yy_c_buf_p) = (char *) 0;
   (yy_init) = 0;
   (yy_start) = 0;

   (yy_start_stack_ptr) = 0;
   (yy_start_stack_depth) = 0;
   (yy_start_stack) =  NULL;

   (yy_state_buf) = 0;
   (yy_state_ptr) = 0;
   (yy_full_match) = 0;
   (yy_lp) = 0;

   /* Defined in main.c */
#ifdef YY_STDINIT
   fortranscannerYYin = stdin;
   fortranscannerYYout = stdout;
#else
   fortranscannerYYin = (FILE *) 0;
   fortranscannerYYout = (FILE *) 0;
#endif

   /* For future reference: Set errno on error, since we are called by
    * fortranscannerYYlex_init()
    */
   return 0;
}

/* fortranscannerYYlex_destroy is for both reentrant and non-reentrant scanners. */
int fortranscannerYYlex_destroy  (void)
{

   /* Pop the buffer stack, destroying each element. */
   while (YY_CURRENT_BUFFER) {
      fortranscannerYY_delete_buffer(YY_CURRENT_BUFFER  );
      YY_CURRENT_BUFFER_LVALUE = NULL;
      fortranscannerYYpop_buffer_state();
   }

   /* Destroy the stack itself. */
   fortranscannerYYfree((yy_buffer_stack) );
   (yy_buffer_stack) = NULL;

   /* Destroy the start condition stack. */
   fortranscannerYYfree((yy_start_stack)  );
   (yy_start_stack) = NULL;

   fortranscannerYYfree ( (yy_state_buf) );
   (yy_state_buf)  = NULL;

   /* Reset the globals. This is important in a non-reentrant scanner so the next time
    * fortranscannerYYlex() is called, initialization will occur. */
   yy_init_globals( );

   return 0;
}

